import React, { Component } from 'react'
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import { Grid } from '@material-ui/core';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';

const styles = theme=> ({
    card:{
        margin: '10px',
        color: '#FFE81F',
        backgroundColor: 'black'
    },
    name:{

        borderBottom: '2px white'
    }
});


export class Planet extends Component {

    constructor(props) {
        super(props);
        this.state = {

            planet: null

        }
    }


    render() {

        let { classes } = this.props;

        return (
            <div>
            <Grid container>

            {(() => {
                if (this.props.planet == null) {
                return (
                    <h1>Loading</h1>
                )

                } else {
                return (
                    this.props.planet.map(planet => (

                        <Grid item sm={2}>
                            <Card className={classes.card}>
                                <CardActionArea>
                                    <CardContent>
                                        <Typography gutterBottom variant="h5" component="h2" className={classes.name}>
                                            {planet.name}
                                        </Typography>

                                        <List style={{color: 'white'}}>

                                                <ListItem>
                                                    <ListItemText>Population: {planet.population}</ListItemText>
                                                </ListItem>

                                                <ListItem>
                                                    <ListItemText>Gravity: {planet.gravity}</ListItemText>
                                                </ListItem>

                                                <ListItem>
                                                    <ListItemText>Diameter: {planet.diameter}</ListItemText>
                                                </ListItem>

                                                <ListItem>
                                                    <ListItemText>created: {planet.created}</ListItemText>
                                                </ListItem>

                                                <CardActions>
                                                    <Button size="small" style={{color: '#FFE81F'}}>
                                                    Know More
                                                    </Button>
                                                </CardActions>

                                        </List>
                                    </CardContent>
                                </CardActionArea>


                            </Card>
                        </Grid>
                        ))
                )
                }
            })()}


            </Grid>
            </div>
        )
    }
}

Planet.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Planet);
